    false,nt"url": null,nt"notes": "The South New Jersey County Lidar project
    is to provide LiDAR data for the New Jersey Department of Environmental Protection
    (NJ-DEP) for Cape May, Cumberland, and part of Salem Counties in New Jersey. These
    datasets will be the initial acquisition to support the United States Geological
    Survey (USGS) and the New Jersey Department of Environmental Protection (NJ-DEP).
    This LiDAR data set was collected in April 2008 for Cape May County and covers 285
    square miles. The data are classified as follows: Class 1 - Unclassified/Extracted
    Features Class 2 - Bare Earth, Ground Class 9 - Water Class 12 - Overlap",nt"license_title":
